document.getElementById('f').addEventListener('change',function() {
  
 
  if(document.getElementById('name').value.length>0){
    var file = document.getElementById('f').files[0];
    getBase64(file).then(
      data => savedata(data)
    );
  }
})

function getBase64(file) {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = () => resolve(reader.result);
    reader.onerror = error => reject(error);
  });
}




function savedata(data){
  var date=getlocaldate(new Date()).split(' ')
  var date1 = date[0].split('-').join('');
  var time = date[1].split(':').join('');
  window.localStorage.setItem(date1+time,JSON.stringify({'name':document.getElementById('name').value,'date':getlocaldate(new Date()),'data':data}))
  $('#exampleModalCenter').modal('hide')

}

$("#filtername").on("keyup", function() {
  var value = $(this).val().toLowerCase();
  $("#ttbody tr").filter(function() {
    $(this).toggle($(this).text().toLowerCase().indexOf(value) > -1)
  });
});

$("#sort").on('click', function() {
  var rows = $("#ttbody tr").get();
  rows.sort(sortTable1);
  $.each(rows, function(index, row) {
      
      $("#ttbody").append(row);
  });
  if (ascending) {
      ascending = false;
  } else {
      ascending = true;
  }
});

function sortTable1(a, b) {
  var A = parseInt($(a).children('td').eq(0).text(), 10);
  var B = parseInt($(b).children('td').eq(0).text(), 10);

  if (ascending) {
      if (A > B) return 1;
      if (A < B) return -1;
  } else {
      if (A > B) return -1;
      if (A < B) return 1;
  }
  return 0;

}



